import React from "react";
import "./navbar.css";
import logo from "../../assets/logosvg.svg";

function navbar() {
  return (
    <div className="navbar">
      <div className="logo">
        <img src={logo} alt="" srcset="" />
      </div>
      <div className="profie-icon"></div>
    </div>
  );
}

export default navbar;
